import './App.css';

function App() {
  return (
    <div class="grid-container">
    <div class="grid-item1">
        <h1 class="headerText">Hi, i'm Zidi</h1>
    </div>
    <div class="grid-item2"></div>
    <div class="grid-item3">
        <div class="square"></div>
    </div>
    <div class="grid-item4"></div>
    <div class="grid-item5"></div>
</div>
  );
}

export default App;
